  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:08.966940\",\n\t\"name\": \"a-special-report-on-fishery-resources-of-the-kenai-peninsula-territory-of-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The commercial fishery resource of the
  Kenai Peninsula has an average annual value of $3,611,000. In addition, a sport
  fishery of considerable importance exists in the area. Since the sport catch ordinarily
  is not sold in the commercial market, no evaluation comparable to that given for
  the commercial fishery is available for the sport fishery. Although the sport fishery
  does not approach the value of the commercial fish as an economic necessity, the
  importance of this fishery is indicated by the fact that an estimated 20,450 fishermen
  spent about 83,000 days engaged in this pursuit during 1955, and spent about $1,389,000
  for equipment, lodging, transportation and other items in connection with their
  fishing trips. When it is remembered that this wealth is a result of a renewable
  resource, its continuing value must be clearly and objectively evaluated in connection
  with any other resource development program.\",\n\t\"license_title\": \"License
